pub fn padding(tbs: [u8; 1200], len: u32) -> [u8; 1152] {
    let mut res = [0; 1152];
    for i in 0..1200 {
        if (i < len) {
            res[i] = tbs[i];
        }
        if (i == len) {
            res[i] = 128;
        }
    }

    let be_len = (len * 8) as Field.to_be_bytes::<2>();
    res[1150] = be_len[0];
    res[1151] = be_len[1];
    res
}

pub fn hash_any(tbs: [u8; 1200], len: u32) -> [u8; 32] {


    let iv = [
        1779033703, 3144134277, 1013904242, 2773480762, 1359893119, 2600822924, 528734635,
        1541459225,
    ];
    let padded = padding(tbs, len);

    let mut blocks : [[u32; 16];18] = [[0; 16]; 18];
    for i in 0..18{
        for ii in 0..16{
            blocks[i][ii] = padded[i * 64 + ii * 4] as u32 * 16777216 + padded[i * 64 + ii * 4 + 1] as u32 * 65536 + padded[i * 64 + ii * 4 + 2] as u32 * 256 + padded[i * 64 + ii * 4 + 3] as u32;
        }
    }

    let mut state = std::hash::sha256_compression(blocks[0], iv);
    for i in 1..18{
        state =  std::hash::sha256_compression(blocks[i], state);
    }
    let mut res: [u8; 32] = [0; 32];

    for i in 0..8{
        let tmp = state[i] as Field.to_be_bytes::<4>();
        res[i * 4] = tmp[0];
        res[i * 4 + 1] = tmp[1];
        res[i * 4 + 2] = tmp[2];
        res[i * 4 + 3] = tmp[3];
    }

    res
}

#[test]
fn test_padding() {
    // println(padding([1; 1200], 1103));
    println(hash_any([1; 1200], 1104));
    println(std::hash::sha256([1;1104]));
}

