use super::rsa::verify_rsa;
use super::sha2_any;

pub fn verify_certificate(
    tbs: [u8; 1200],
    pk: [Field; 18],
    reduction: [Field; 18],
    signature: [Field; 18],
    len: u32
) -> [u8; 32]{
    let hashed = sha2_any::hash_any(tbs, len);

    let _ = verify_rsa::<2048, 18, 32, 65537>(pk, reduction, signature, hashed);

    hashed
}

#[test]
fn test_verify() {
    // replace with actual data
    let _ = verify_certificate(
        [
           0x00; 1200
        ],
        [
           0x00; 18
        ],
        [
            0x00; 18
        ],
        [
            0x00; 18
        ],
        1103
    );
}
